import { HomePage_1, HomePage_2 } from "./Pages/Pages";


const Home = () => {
    const className = {
      container: "w-full font-Roboto bg-[#1b1c1e]",
    };

    return(
        <div className={className.container}>
           <HomePage_1 />
           <HomePage_2 />
        </div>
    )
}

export default Home;
